import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Ajustando para a porta 8010
    axios.get('http://localhost:8010/api/endpoint')  // Substitua com o seu endpoint real
      .then(response => {
        setData(response.data);  // Armazena os dados da resposta na variável de estado
      })
      .catch(error => {
        console.error('Erro ao fazer a requisição', error);
      });
  }, []);

  return (
    <div>
      <h1>Dados do Back-End:</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.nome}</li>
        ))}
      </ul>
    </div>
  );
};

export default App;
